import Head from 'next/head'
import React from 'react';

const Meta = () => {
    return (
      <Head>
        <meta name="viewport" content="width=device-width, initial-scale=1.0" />
        <meta charSet="UTF-8"/>
        <style>
@import url('https://fonts.googleapis.com/css?family=Roboto&display=swap');
</style>
      </Head>
    );

}

export default Meta;
